let mergedObject = {};
const items = $input.all();
items.forEach(item => {
  Object.assign(mergedObject, item.json);
});
return [
  {
    json: mergedObject
  }
];

for (const item of $input.all()) {
  item.json.decoded = Buffer.from(item.json.content, 'base64').toString('utf-8');
}

return $input.all();

const currentDate = new Date().toISOString().split('T')[0];
const resultEncryptDecrypt = $('Results').first().json['Result Encrypt Decrypt'];
const resultSignVerify = $('Results').first().json['Result Sign Verify'];
const resultCombined = $('Results').first().json['Result Combined'];

for (const item of $input.all()) {
  let decodedContent = item.json.decoded;

  // ENCRYPT / DECRYPT
  let resultText = resultEncryptDecrypt ? "✅ Success" : "❌ Failure";

  decodedContent = decodedContent.replace(
    /<span id="test-encrypt-date">[\d-]+<\/span>/,
    `<span id="test-encrypt-date">${currentDate}</span>`
  );
    decodedContent = decodedContent.replace(
    /<span id="test-decrypt-date">[\d-]+<\/span>/,
    `<span id="test-decrypt-date">${currentDate}</span>`
  );

  decodedContent = decodedContent.replace(
    /<span id="test-encrypt-result">.*?<\/span>/,
    `<span id="test-encrypt-result">${resultText}</span>`
  );
    decodedContent = decodedContent.replace(
    /<span id="test-decrypt-result">.*?<\/span>/,
    `<span id="test-decrypt-result">${resultText}</span>`
  );

  // SIGN / VERIFY
  resultText = resultSignVerify ? "✅ Success" : "❌ Failure";

  decodedContent = decodedContent.replace(
    /<span id="test-sign-date">[\d-]+<\/span>/,
    `<span id="test-sign-date">${currentDate}</span>`
  );
    decodedContent = decodedContent.replace(
    /<span id="test-verify-date">[\d-]+<\/span>/,
    `<span id="test-verify-date">${currentDate}</span>`
  );

  decodedContent = decodedContent.replace(
    /<span id="test-sign-result">.*?<\/span>/,
    `<span id="test-sign-result">${resultText}</span>`
  );
    decodedContent = decodedContent.replace(
    /<span id="test-verify-result">.*?<\/span>/,
    `<span id="test-verify-result">${resultText}</span>`
  );

    // COMBINED
  resultText = resultSignVerify ? "✅ Success" : "❌ Failure";

  decodedContent = decodedContent.replace(
    /<span id="test-encrypt-and-sign-date">[\d-]+<\/span>/,
    `<span id="test-encrypt-and-sign-date">${currentDate}</span>`
  );
    decodedContent = decodedContent.replace(
    /<span id="test-verify-and-decrypt-date">[\d-]+<\/span>/,
    `<span id="test-verify-and-decrypt-date">${currentDate}</span>`
  );

  decodedContent = decodedContent.replace(
    /<span id="test-encrypt-and-sign-result">.*?<\/span>/,
    `<span id="test-encrypt-and-sign-result">${resultText}</span>`
  );
    decodedContent = decodedContent.replace(
    /<span id="test-verify-and-decrypt-result">.*?<\/span>/,
    `<span id="test-verify-and-decrypt-result">${resultText}</span>`
  );

  item.json.decoded = decodedContent;
}

return $input.all();
